import React from 'react';
import { Menu, Layout, Image } from 'antd';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import logo from '../../img/logoshop.png';
import PersonOutlineIcon from '@material-ui/icons/PersonOutline';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
const { Header } = Layout;
const HeaderShopping = () => {
  const numberCart = useSelector(
    state => state.reducerCart.shoppingCart
  ).length;
  return (
    <Header className="container_header">
      <div className="container_header_logo">
        <Image src={logo} alt="No" width={150} height={130} preview={false} />

        <div className="menu">
          <ul>
            <li>Coffee</li>
            <li>Tea</li>
            <li>Milk</li>
          </ul>
        </div>
        <div className="icon">
          <PersonOutlineIcon />
          <ShoppingCartIcon />
        </div>
      </div>

      {/* <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
        <Menu.Item key="/">
          <Link to="/"> Products</Link>
        </Menu.Item>
        <Menu.Item key="cart">
          <Link to="/cart">cart ({numberCart})</Link>
        </Menu.Item>
        <Menu.Item key="login">
          <Link to="/login">Login</Link>
        </Menu.Item>
      </Menu> */}
    </Header>
  );
};
export default React.memo(HeaderShopping);
